import Home from '~/pages/Home';
import Following from '~/pages/Following';
import Profile from '~/pages/Profile';

const publicRoutes = [
    {
        path: '/',
        name: 'Home',
        component: Home,
    },
    {
        path: '/following',
        name: 'Following',
        component: Following,
    },
    {
        path: '/profile',
        name: 'Profile',
        component: Profile,
    },
];
const privateRoutes = [];
export { publicRoutes, privateRoutes };
